webpackJsonp([0x79cac10268fe],{321:function(e,t){e.exports={data:{imageDefault:{sizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"/static/logo-symbol-5a5508700e3f88b4596e0057e2f43f56-48dbb.png",srcSet:"/static/logo-symbol-5a5508700e3f88b4596e0057e2f43f56-a07a3.png 125w,\n/static/logo-symbol-5a5508700e3f88b4596e0057e2f43f56-6db2f.png 250w,\n/static/logo-symbol-5a5508700e3f88b4596e0057e2f43f56-48dbb.png 500w,\n/static/logo-symbol-5a5508700e3f88b4596e0057e2f43f56-12ace.png 750w,\n/static/logo-symbol-5a5508700e3f88b4596e0057e2f43f56-cbba3.png 1000w,\n/static/logo-symbol-5a5508700e3f88b4596e0057e2f43f56-a866e.png 1500w,\n/static/logo-symbol-5a5508700e3f88b4596e0057e2f43f56-f50e1.png 2316w",sizes:"(max-width: 500px) 100vw, 500px"}},contentfulCategory:{id:"qELEV2eAdUaQYWq80We2E",category:"Beauty",blogpost:[{id:"c41WrRj1obCS8mCuOWCmgMu",title:"Things that are Just a Number",createdAt:"February 18, 2018",featuredImage:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.255952380952381,src:"//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=800&q=50",srcSet:"//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=200&h=159&q=50 200w,\n//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=400&h=318&q=50 400w,\n//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=800&h=637&q=50 800w,\n//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=1055&h=840&q=50 1055w",srcWebp:"//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=800&q=50&fm=webp",srcSetWebp:"//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=200&h=159&q=50&fm=webp 200w,\n//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=400&h=318&q=50&fm=webp 400w,\n//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=800&h=637&q=50&fm=webp 800w,\n//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg?w=1055&h=840&q=50&fm=webp 1055w",sizes:"(max-width: 800px) 100vw, 800px"},id:"c4nBK0FTPtSYwqM4Q8SauwO",file:{url:"//images.ctfassets.net/t8j0ewtik3c3/4nBK0FTPtSYwqM4Q8SauwO/bf8e90962701acda5f785ee00663cefd/ashley-beach.jpg",fileName:"ashley-beach.jpg",contentType:"image/jpeg"}},content:{childMarkdownRemark:{html:"<p>We love to put people and things into categories. That person is smart, funny, fat, beautiful, passionate, lazy, crippled, perfect, etc. We let these categories define us. I've realized there are two categories I've been defining myself by for almost my whole life: my age and my weight.I'm learning andconstantly being reminded they are just numbers.</p>\n<p>Age\nLately people have been saying this phrase to me: \"Oh, you're too young to be feeling/doing/experiencing [fill in the blank].\"</p>\n<p>\"You're too young to be stressed.\"</p>\n<p>\"You're too young to be married.\"</p>\n<p>Even my dentist said to me, \"You're too young to have this issue with your teeth.\" (Whattt?!)</p>\n<p>Since when do all these issues have an age limit?! (I realize marriage does have legal age limits, which are necessary.) I find it frustrating because it feels like all these people are trying to make me wrong for something I'm experiencing-things that are completely out of my control. It feels demeaning. I do not believe those who talk like this are trying to put me down, but it's hard not to see that way. Has any one else ever had a similar experience?</p>\n<p>I could go on and on about how these people do not know my life experiences. They do not know the cause of my stressors. They do not know the careful thought and years I put into making the decision to marry the man of my dreams.</p>\n<p>Sometimes I feel judged.</p>\n<p>But if I'm being honest, I'm only judging myself.</p>\n<p>People who make comments about me being too young for these things don't even realize the depth of what they are saying to me. They don't know my past or even my present. I can't find them in the wrong.</p>\n<p>Why does this upset me?Does part of me agree with them?</p>\n<p>I've always believed that certain things happen at certain stages of your life. High school is supposedly the best time you'll ever have. Was it for me? Nope. College is suppose to be a crazy party, full of fun, all nighters, and great memories. While I had some of these, many times are overshadowed by the weight of getting good grades and balancing my personal life and professional life.</p>\n<p>I matured at a young age, started working at 14, and spent a lot of time while I was younger caring for my sisters. I've never fit into the mold. I've never 'acted my age' or even been treated my age.</p>\n<p>For most of my life I've loved that, but sometimes I despise that quality about me. I wanted to have those care-free youthful years. I feel robbed. I wanted to have a great experience in high school, didn't happen (I'm sure I'm not alone on this one). I don't want to have all this anxiety to work through.</p>\n<p>Maybe that's why I'm so sensitive about people telling me I'm too young to be experiencing whatever it is I'm experiencing. I want them to be right. I feel like I am too young for this. I want to go back in time and be carefree. When will I be old enough to experience these things?</p>\n<p>I'm experiencing life. You never know what will happen. There is no age limit. Some children have experienced more than I will ever experience in my lifetime.</p>\n<p>I have friends now who are in their thirties and forties. It's awesome. I never thought I could have friends so 'old'. But we have so much in common! They don't see me as a younger or inferior person. It's helped me to push past many of the labels I've put on age limits.</p>\n<p>I don't know how I'll react when the next person tells me I'm to young to be doing/feeling/experiencing whatever. I just hope I can learn to understand age is a number. It doesn't define me in any way.</p>\n<p>Weight\nDo you weigh yourself? Do you ever look at the scale and think, 'that can't be right...'</p>\n<p>Do you define yourself by the number you see on the scale? So many of us do that. It's a good day if you're 2 pounds down from last week. If you're 2 pounds up, your day is ruined.</p>\n<p>Or perhaps you never weigh yourself. I use to do that. Avoid the evil scale at all costs.</p>\n<p>Maybe you have your own method of measuring.You look in the mirror and notice your weight. Maybe you notice how your clothes fit. That's mostly what I do. Last fall when the weather started to cool off I brought out all my pants and sweaters from storage. I switched out my summer wardrobe for my fall one. I took a nice shower, got all ready, and attempted to put one of my old favorite jeans back on. Then I realized- they're too tight. I mean, I could probably wear them if I wanted to be super uncomfortable and constantly reminded that my hips were larger. It upset me for a while. And by a 'while' I mean like months. I'm just about over it now. Thank goodness!</p>\n<p>Why do I [we] care so much about our size?! That little number on the scale or on the tag on our jeans has so much power over our lives and our hearts.</p>\n<p>The scale goes up and down, clothes get smaller and larger, we are still who we are. As one of my favorite artists says:</p>\n<p>'What lasts longer in this life; character or rock hard thighs?' -Kendall Payne</p>\n<p>I've been so mean to myself trying to attain my ideal of beauty and the ideal weight. I realize something now, I'll never get there! Even when I was at my thinnest I still struggled with loving my body. The time is now. We need to rise above the battle of our weight issues and realize how insignificant they are in light of life and eternity. How do we want our future children, our future daughters, to think about their weight and body image?</p>\n<p>Age and weight are JUST A NUMBER. They don't define me. I am defined by my Creator and the inescapable love he has for me. What defines you?</p>\n<p>-Ashley</p>\n<p>I really like this new video from Dove's campaign. Take a look!</p>\n<p><a href=\"https://www.youtube.com/watch?v=3tM2Z0-zFcw\">https://www.youtube.com/watch?v=3tM2Z0-zFcw</a></p>"}}},{id:"c5uoePXMlr2yE2iMacm0i4u",title:"A Love Letter to my Five-Year-Old-Self",createdAt:"February 18, 2018",featuredImage:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1,src:"//images.ctfassets.net/t8j0ewtik3c3/1gR65aqubAGGaGsuAwicSS/bf8e90962701acda5f785ee00663cefd/baby-ashley.jpg?w=800&q=50",srcSet:"//images.ctfassets.net/t8j0ewtik3c3/1gR65aqubAGGaGsuAwicSS/bf8e90962701acda5f785ee00663cefd/baby-ashley.jpg?w=200&h=200&q=50 200w,\n//images.ctfassets.net/t8j0ewtik3c3/1gR65aqubAGGaGsuAwicSS/bf8e90962701acda5f785ee00663cefd/baby-ashley.jpg?w=400&h=400&q=50 400w,\n//images.ctfassets.net/t8j0ewtik3c3/1gR65aqubAGGaGsuAwicSS/bf8e90962701acda5f785ee00663cefd/baby-ashley.jpg?w=800&h=800&q=50 800w",srcWebp:"//images.ctfassets.net/t8j0ewtik3c3/1gR65aqubAGGaGsuAwicSS/bf8e90962701acda5f785ee00663cefd/baby-ashley.jpg?w=800&q=50&fm=webp",srcSetWebp:"//images.ctfassets.net/t8j0ewtik3c3/1gR65aqubAGGaGsuAwicSS/bf8e90962701acda5f785ee00663cefd/baby-ashley.jpg?w=200&h=200&q=50&fm=webp 200w,\n//images.ctfassets.net/t8j0ewtik3c3/1gR65aqubAGGaGsuAwicSS/bf8e90962701acda5f785ee00663cefd/baby-ashley.jpg?w=400&h=400&q=50&fm=webp 400w,\n//images.ctfassets.net/t8j0ewtik3c3/1gR65aqubAGGaGsuAwicSS/bf8e90962701acda5f785ee00663cefd/baby-ashley.jpg?w=800&h=800&q=50&fm=webp 800w",sizes:"(max-width: 800px) 100vw, 800px"},id:"c1gR65aqubAGGaGsuAwicSS",file:{url:"//images.ctfassets.net/t8j0ewtik3c3/1gR65aqubAGGaGsuAwicSS/bf8e90962701acda5f785ee00663cefd/baby-ashley.jpg",fileName:"baby-ashley.jpg",contentType:"image/jpeg"}},content:{childMarkdownRemark:{html:"<p>(That's my sister Jessie on the left and me on the right)</p>\n<p>I think we all know it is important to love ourselves, right? But do our actions and how we treat ourselves show that? Do our thoughts about ourselves convey love and acceptance?</p>\n<p>I have no problem loving those around me. I try to forgive. I try to be encouraging. I try to overlook mistakes.</p>\n<p>Do I take that same care for myself? No. I am my toughest critic.Many of us are like this. Why?</p>\n<p>Why are we so hard on ourselves? Would we talk to our best friends with the mental abuse we are constantly telling ourselves?</p>\n<p>You look into the mirror. What do you say to yourself? 'I am beautiful. I am a child of God. I am a work of art. I am healthy'. No, we say things like 'Why are you wearing this shirt. You look so fat. I am never going to be good enough. Maybe I should dye my hair, again. I need a new wardrobe. I'll never be as pretty as her'.</p>\n<p>I beat myself up all the time. If I eat ice cream, whoops, this is the beginning of a downward spiral of sugary torture for me. I'm going to gain ten pounds for that bite, and another five for that bite. I have failed at another diet attempt.</p>\n<p>When I feel stress I tell myself I'm weak. I obviously can't handle the pressure of life. Everyone else seems to be doing alright.</p>\n<p>I don't have a high-paying job. Well I just wasted my college education. If I were really serious about doing something with my life I would pursue a better career. A more important career.</p>\n<p>I know the way we talk to ourselves. And let me tell you, it's wrong. It's a lie. It's cruel.</p>\n<p>I want to encourage you to take note of when you are putting yourself down. The next time you notice yourself doing this, try a little exercise.</p>\n<p>Close your eyes\nPicture yourself as a little five-year-old girl (or boy)\nSee yourself giggling, laughing, playing\nTalk to your younger self\nTell your five-year-old self everything you belive about him or her (you're beautiful, you're innocent in God's eyes, you're gonna be okay, you're strong, you're not a failure)\nRealize you are still that person!\nI love this exercise because something about it is so beautiful. We would NEVER say the hateful things we say to ourselves now if we were talking to an innocent child. That's how we need to see ourselves because that's how the Lord sees us. Do you believe that?</p>\n<p>Here's a love letter I wrote to my five-year-old self:</p>\n<p>Dear freckle-faced Ashley,</p>\n<p>You are so pretty. Your red hair is so unique and beautiful. Who cares if you ever get teased for it, one day you will love and embrace it. In fact, you'll have many friends who dye their hair red. Oh and your freckles, you'll learn to love them, too. Your husband will absolutely adore them on your face.</p>\n<p>You're shy, and that's okay. It doesn't make you wrong. You don't have anything to prove. Just because you are too afraid to talk in front of new people all the time doesn't mean you won't have great friends. You will have the best friends any girl could ever hope for. Be patient. God will bring them to you at just the right time.</p>\n<p>You might have some trouble showing emotion. You're not weird. It can be hard to express yourself and cry in front of others. You'll keep learning how to do this.</p>\n<p>You get nervous sometimes. And there will be times in life when you feel really nervous and anxious- but you'll survive. You are strong. You will get through it all and God will be so proud of you for not self-medicating or doing anything destructive. You will have all the tools you need. In fact, you already have all the tools you need. You just don't know it.</p>\n<p>I'm sorry for the way I have treated you lately. I've been critical and hateful. It's just, the world is clouding my view. I can't see you clearly sometimes. I need to be reminded of your beauty. I need to be reminded of your joy. I am hurting you and don't even realize it. I blame you for being weak. You're not weak. You are so unquestionably human. I ridicule your appearance. All you want to do is be seen as you truly are- a beautiful little girl.</p>\n<p>I promise to try and be more kind.</p>\n<p>xox Ashley</p>\n<p>What would you like to say to your five-year-old self?</p>"}}}]}},pathContext:{category:"Beauty"}}}});
